webpackJsonp([0xecdc85b985c6],{7105:function(t,a){t.exports={data:{post:{html:'<p>I guess it\'s because I live in the Protestant north, but I never knew that referring to Catholic holiday of <em>Fronleichnam</em> as "Happy Cadaver Day" was so<br />\n<a href="http://fistfulofeuros.net/archives/000913.php" title="A Fistful of Euros: Another Brick In The Wall.">controversial</a> (scroll to the comments). Up here it\'s called that all the time. Wasn\'t the 30 Years\' War supposed to have settled all this?</p>',fields:{title:"Happy Cadaver Day",date:"08 Nov 2004",url:"https://papascott.de/2004-11-08-happy-cadaver-day/"}}},pathContext:{slug:"/2004-11-08-happy-cadaver-day/",prev:{fields:{title:"Global Reach",date:"08 Nov 2004",slug:"/2004-11-08-global-reach/"}},next:{fields:{title:"A Nation of Pyromaniacs",date:"09 Nov 2004",slug:"/2004-11-09-a-nation-of-pyromaniacs/"}}}}}});
